import React, { useState } from 'react'
import Earning from './Card_assets/Earning.png'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faChevronDown } from '@fortawesome/free-solid-svg-icons'

const data = [{
    id:1,
    image:'Earning',
    text:'Total earning',
    num:'$13,690',
    percent:'36%'
}    ]


const Ecard = () => {
  return (
    <div>
    {data.map((dataa)=>{
       return(
        <div class='flex p-4 ' > 
            <img src={Earning} alt='Total Earning' class='w-10 h-40 basis-1/2'></img>
            <div class='basis-1/2 pl-4'>
        <p>{dataa.text}</p>
        <p>{dataa.num}</p> <span>{dataa.percent} </span>
        <p><FontAwesomeIcon icon={faChevronDown}  /></p>
        <ol>
            <li>Income</li>
            <li>Investment</li>
            <li>Savings</li>
        </ol>
        </div>
        </div>
    ) } )}
     </div>
     )}

export default Ecard
